						Label(Is: { In: "Status" })
						ScalarTypeId(Is: { In: [String] })
						DifferentiateNullAndVoid(Is: { In: true })
						ValueProvider(Is: { In: "CreateEvents" })
					}
				}
				And {
					... on CreateFieldMap {
						Index
						Id(Is: { In: "issue-id" })
